import React from 'react';
import './Header.css'; // CSS dosyasını dahil et

const Header = () => {
  return (
    <header className="header">
      <div className="logo-container">
        <img src="/path/to/logo.png" alt="Semaver Logo" className="logo" />
      </div>
      <div className="nav-links">
        <a href="/login" className="link icon-login">Giriş</a>
        <a href="/cart" className="link icon-cart">Sepet</a>
      </div>
    </header>
  );
}

export default Header;
